INSERT INTO `pondok` (`id`, `nama_pondok`, `nama_admin_pondok`, `alamat`, `no_izin`, `no_hp`, `email`, `password`, `visi`, `misi`, `sejarah`, `foto`, `created_at`, `updated_at`) VALUES
(22, 'Wali Songo Pontianak', 'KH. Muhdin Muadzizaaa', 'JL.H.AGUS SALIM GG.H.UMAR NO.5. KELURAHAN SAMPIT, KECAMATAN. DELTA PAWAN', '123-4536-21sds', '08989815040', 'Walisongo@gmail.com', '$2y$10$frGVqRuQQ6rdIf2sh/3kN.QcDZQCQY.w//LL7j2KxSn7/1DDcJwgS', 'Menjadi lembaga pendidikan Islam yang berkualitas sebagai kontributor terdepan dalam mencetak sumber daya muslim yang sholeh, muslih (reformer) dan kader ummat.', 'Transformasi ilmu pengetahuan;\r\nMenanamkan akhlakul karimah dan nilai-nilai Islam;\r\nBerakidah benar sesuai dengan manhaj Ahlu Sunnah Wal Jamaah;\r\nMampu berkomunikasi dalam bahasa Arab dan Inggris;\r\nMemiliki talenta dalam berdawah dan mengarahkan masyarakat menuju kehidupan yang Islami.', 'Sebagai rintisan, didirikan lembaga pendidikan Islam pertama berupa Madrasah Diniyyah Bustanul Ulum Al-Islamiyah (BUI) pada tahun 1946. Awalnya, madrasah ini masuk sore lalu berubah pagi. Nama pun diganti menjadi Madrasah Ibtidaiyah Mambaul Huda Al-Islamiyah pada tahun 1958. Untuk menampung lulusan sekolah ini, pada tahun 1958 dibuka madrasah tingkat lanjutan yang bernama Tsanawiyah lil Muallimin. Kemudian berganti menjadi Manahiju Tarbiyatil Muallimin/Muallimat Al-Islamiyah pada tahun 1972. Pada tahun 1980 berubah lagi menjadi Tarbiyatul Muallimin al-Islamiyah dan Tarbiyatul Muallimat al-Islamiyah.', 'app/images/pondok/-1639136533-iFegH.jpeg', '2021-12-09 07:42:13', '2022-01-12 08:48:50'),
